import React from 'react'
import ReactDOM from 'react-dom'
const Header = (props) => {
    return (
        <div>
            <p> {props.course} </p>
        </div>
    )
}
const Part = (props) => {
    return (
        <div>
            <p>
                {props.part} {props.exercises}
            </p>
        </div>
    )
}
const Content = (props) => {
    return (
        <>
            <Part part = {props.part1} exercises = {props.excersises1}/>
            <Part part = {props.part2} exercises = {props.excersises2}/>
            <Part part = {props.part3} exercises = {props.excersises3}/>
        </>
    )
}

const Total = (props) => {
    return (
        <div>
            <p>yhteensä {props.part1 + props.part2 + props.part3}</p>
        </div>
    )
}
const App = () => {
  const course = 'Half Stack -sovelluskehitys'
  const part1 = 'Reactin perusteet'
  const exercises1 = 10
  const part2 = 'Tiedonvälitys propseilla'
  const exercises2 = 7
  const part3 = 'Komponenttien tila'
  const exercises3 = 14

  return (
    <>
        <Header course = {course} />
        <Content
            part1 = {part1}
            excersises1 = {exercises1}
            part2 = {part2}
            excersises2 = {exercises2}
            part3 = {part3}
            excersises3 = {exercises3}
        />
      <p>yhteensä {exercises1 + exercises2 + exercises3} tehtävää</p>
    </>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
